        // 4.Data Format

        const res = await fetch('https://disease.sh/v3/covid-19/continents', {
            method: 'GET',
            body: JSON.stringify(),
            headers: { 'Content-Type': 'application/json' }
        })
        console.log(res);
     }
  return (
   <>
    
   </>
  )
}

export default Country
